import { Logo, BurgerIcon, ListIcon, ProfileIcon } from '@ya.praktikum/react-developer-burger-ui-components';
import { MenuItem } from '../UI/MenuItem/MenuItem.module';

import appHeader from './AppHeader.module.css';

const AppHeader = () => {
    return (
        <header className={appHeader.header}>
            <nav className={appHeader.navbar}>
                <ul className={appHeader.buttons}>
                    <MenuItem icon={<BurgerIcon type='primary' />} text='Конструктор'/>

                    <li className='pl-5 pr-5 pb-4 pt-4'>
                        <a className={appHeader.link} href='/'>
                            <ListIcon type='secondary' />
                            <p className='text text_type_main-default text_color_inactive'>
                                Лента заказов
                            </p>
                        </a>
                    </li>
                </ul>
                <Logo />
                <div className={appHeader.profile}>
                    <a className={`${appHeader.link} pl-5 pr-5 pb-4 pt-4`} href='/'>
                        <ProfileIcon type='secondary' />
                        <p className='text text_type_main-default text_color_inactive'>
                            Личный кабинет
                        </p>
                    </a>
                </div>
            </nav>
        </header>
    );
};

export default AppHeader;
